ERROR - 2019-05-12 01:43:34 --> Query error: Unknown column 'DETAIL' in 'field list' - Invalid query: INSERT INTO `r_lap_pusdatin_icp` (`TANGGAL_LAPORAN`, `KETERANGAN`, `DETAIL`, `USER_ENTRY`, `TANGGAL_ENTRY`, `FLATFORM_ENTRY`) VALUES ('2019-05-12', 'Prakiraan wilayah potensi tejadi gerakan tanah di Indonesia pada bulan  April  2019\r\ndibandingkan Maret  2019, potensinya relatif sama tingginya    utamanya wilyah indonesia\r\nbagian Timur, namun terjadi penurunan potensinya meliputi wilayah   Wilayah Sumatera\r\nbagian Timur,Jawa , Bali . dan Nusantenggara Barat.\r\n\r\nGerakan tanah terakhir terjadi :\r\n\r\n1. \r\nKabupaten Sukabumi, Provinsi Jawa Barat \r\n2. \r\nKabupaten Ciamis, Provinsi Jawa Barat \r\n3. Kota Bandar Lampung, Provinsi  Lampung\r\n4. \r\nKabupaten Kotabaru, Provinsi Kalimantan Selatan \r\n\r\nPenyebab gerakan tanah adalah pelapukan tanah yang tebal, kemiringan lereng yang terjal,\r\nserta dipicu oleh curah hujan yang tinggi dengan durasi yang lama sebelum terjadinya\r\ngerakan tanah.', 'Dampak : Gerakan tanah / tanah longsor menyebabkan  1 rumah rusak di  Kabupaten\r\nSukabumi, Provinsi Jawa Barat dan di Kabupaten Ciamis, Provinsi Jawa Barat, akses jalan\r\nterhambat di Kota Bandar Lampung, Provinsi  Lampung, 3 rumah rusak berat dan 4 rumah\r\nrusak ringan,   2 orang meninggal dunia di Kabupaten Kotabaru, Provinsi Kalimantan Selatan.\r\n\r\nPeta prakiraan potensi gerakan tanah dari Badan Geologi perlu diacu sebagai peringatan\r\ndini.  Masyarakat dapat mengunduh melalui www.vsi.esdm.go.id.', '2', '2019-05-12 01:05:34', 'WEB')
